const range = "";
const rangeArr = Array.from(range);

function productFromArr(arr) {
    let p =1;
    arr.forEach(value => p *= value);
    return p;
}

function biggest(num1=0, num2 = 0) {
    let biggest = num1 > num2 ? num1 : num2;
    return biggest;
}

let slicedArr = [];
let biggestProduct = product = 0;
for(let start = 0, end = 13; start <= rangeArr.length - 13 && end <= rangeArr.length; start++, end++){
        slicedArr = rangeArr.slice(start, end);
        product = productFromArr(slicedArr);
        biggestProduct = biggest(product, biggestProduct);
}

console.log(biggestProduct);
